import React,{ Component } from 'react';

import myData from './menu.json';

class SpecialOffers extends Component {


	render(){

		let data = myData.map((item,i)=>{
			if(i <2){
			return(

					<div className="card-container col-lg-4" key={item.id}>

						<div className=" row MuiGrid-root food-card-l1 MuiGrid-container MuiGrid-direction-xs-column" description="A tender 13 oz. seasoned T-Bone steak served with two eggs, hash browns and bread" cuisine="American" preparation="4">

							<div className="image col-lg-12">
								<a href="#">
									<img className="item-image-l1" draggable="false" src={ item.image } />
								</a>
								<span className="label">Chief Special</span>
							</div>

							<div className="MuiGrid-root info MuiGrid-container MuiGrid-direction-xs-column MuiGrid-justify-xs-space-between">
								<div className="title">T-Bone Steak &amp; Eggs</div>
							</div>
							<div class="sub-title">
								<a class="main" href="#">A'la Carte</a>
								<a class="sub" href="#">American</a>
								<a class="sub" href="#">Main Course</a>
							</div>
						</div>
					</div>
			)
		}
		});

		return(


				<div className="container">
					<div className="header-l2 col-md-12 text-left">
						<div className="title ">Special Offers</div>
						<div className="MuiGrid-root sub-title MuiGrid-container MuiGrid-justify-xs-space-between">
							<span className="text"></span>
						</div>
					</div>
					<div className="horizontal-list-scroll-bar-l1 scroll-bar">
						<div className="bar">
							<div className="cursor"></div>
						</div>
					</div>

					<div className="row" >

						{data}	
					</div>
				</div>
		)
	}
}

export default SpecialOffers;
